Ms. ownership inscription of Paul Christ Gottllieb: &quot;Theophili Pauli Christii Coburgensis&quot;

Gottlieb Paul Christ (1707-1786), professor, librarian and court functionary at Ansbach.
In their finding aid Aldine Press Books at the Harry Ransom Humanities Research Center, The University of Texas at Austin (Austin: The Center, 1998), Craig W. Kallendorf and Maria X. Wells identify the ex-libris &quot;Theophili Pauli Christi&quot; as &quot;Gottlieb Paul Christ (18th cent.), prof. at Anspach Gymnasium&quot;. According to his biographical entry in C.A. Baader, Lexikon Verstorbener Schrifsteller des 18. und 19. Jahrhunderts (Augsburg: Von Jenisch- und Stage'schen Buchhandlung, 1825), Bd. 2, T. 1, p. 22, Christ was born in Coburg but came to Ansbach in 1728 to take service with Freiherr von Seckendorff (probably Christoph Ludwig Freiherr von Seckendorff-Aberdar). He went abroad on several diplomatic missions and became the librarian for the Ansbacher Schlossbibliothek. (According to E.F.C. Oertel in Georg Ludwig Oeder der erste Rektor bei der Einweihung des neuen Gymnasiums in Ansbach am 12. Juni 1737 ... (Ansbach: Oertel, 1837) p. 54-55, he got the job in 1738; according to the Schlossbibliothek's history web page, he was the second librarian to be appointed.) In 1737 he was appointed professor at the gymnasium in Ansbach and published a number of works on historical subjects; he also continued to serve at court as a councillor. He has a VIAF entry here.]

